import React from 'react'
import styled from 'styled-components'
import { colors } from '../../styles/Variables'
import { Link } from 'react-router-dom'

const Container = styled.div`
  width: 100%;
  background-color: ${colors.backgroundBlack};
  color: ${colors.white};
  padding: 16px;
  display: flex;
`
const Left = styled.div`
  display: flex;
  align-items: center;
`
const Logo = styled.div`
a {
    color: ${colors.white}
}
`
const Lists = styled.ul`
  display: flex;
  padding: 0 32px;
  li{
      margin-right: 16px;
      font-size: 1.1rem;
  }
  a{
      color: ${colors.white}
  }
`

const Header = () => {
    return (
        <Container>
            <Left>
                <Logo>
                    <Link to='/'>
                        <h1>Github Viewer</h1>
                    </Link>
                </Logo>
                <Lists>
                    <Link to='/issue'>
                        <li>Issue</li>
                    </Link>
                    <Link to='/pullRequst'>
                        <li>Pull Request</li>
                    </Link>
                </Lists>
            </Left>




        </Container>
    );
}

export default Header
